// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.8.0;

contract ResourceRental {
    // Model a Rental
    struct Rental {
        string resourceName;
        uint256 bookingId;
        uint256 resourceId;
        uint256 startTimestamp;
        uint256 endTimestamp;
    }

    // Model a Renter
    struct Renter {
        uint256 renterId;
        string renterName;
        uint256 rentCount;
    }

    // Model a Resource
    struct Resource {
        uint256 resourceId;
        string name;
        string picture;
        string location;
    }

    // Model a Resource Advert
    struct ResourceAdvert {
        uint256 advertId;
        uint256 resourceId;
        string fromTimeStamp;
        string toTimeStamp;
    }

    // Model a University
    struct University {
        uint256 universityId;
        string name;
        address universityAddress;
    }

    // Store renters
    // solidity generiert getter
    mapping(uint256 => Renter) public renters;
    mapping(uint256 => Resource) public resources;
    mapping(uint256 => ResourceAdvert) public resourcesAdverts;
    mapping(uint256 => University) public universities;

    // Store index
    uint256 public rentersCount;
    uint256 public resourcesCount;
    uint256 public resourcesAdvertCount;
    uint256 public universitiesCount;

    // Store Rental

    // Read Rental
    string public candidate;

    function addRenter(string memory _name) private {
        // represent Id of the renter
        rentersCount++;
        renters[rentersCount] = Renter(rentersCount, _name, 0);
    }

    function addUniversity(string memory _name, address _address) private {
        // represent Id of the University
        universitiesCount++;
        universities[universitiesCount] = University(
            universitiesCount,
            _name,
            _address
        );
    }

    function addResource(
        string memory _name,
        string memory _picture,
        string memory _location
    ) private {
        // represent Id of the renter
        resourcesCount++;
        resources[resourcesCount] = Resource(
            resourcesCount,
            _name,
            _picture,
            _location
        );
    }

    function addResourceAdvert(
        uint256 _resourceId,
        string memory _fromTimeStamp,
        string memory _toTimeStamp
    ) private {
        // represent Id of the renter
        resourcesAdvertCount++;
        resourcesAdverts[resourcesAdvertCount] = ResourceAdvert(
            resourcesCount,
            _resourceId,
            _fromTimeStamp,
            _toTimeStamp
        );
    }

    // Store Rental -> from to free

    // Fetch Rental

    // Store Rental count

    // isUniversity
    modifier isUniversity() {
        require(true, "Caller is no university");
        _;
    }

    // making the function pure or view
    // to call it through web3.js without needing
    // a trancaction -> no gas cost, no confirmation delay
    function isSenderUniversity(uint256 _id) public view returns (bool) {
        return msg.sender == universities[_id].universityAddress;
    }

    // Constructor
    constructor() public {
        // add example renters
        addRenter("Student 1");
        addRenter("Professor 1");

        // add example resources
        addResource("Normal Room", "images/room1.jpeg", "Furtwangen, Germany");
        addResource("Concert Hall", "images/room1.jpeg", "Mannheim, Germani");
        addResource("Theater", "images/room1.jpeg", "Rom, Italy");
        addResource("Server Room", "images/room1.jpeg", "Paris, France");
        addResource("Test Room", "images/room1.jpeg", "Barcelona, Spain");
        addResource(
            "Schulungszentrum Darmstadt",
            "https://www.schulungszentrum-darmstadt.de/wp-content/uploads/2019/09/DSC1868.jpg",
            "Darmstadt, Germany"
        );

        // add universities who are allowed to create resrouces
        // addUniversity(
        //     "Hochschule Furtwangen",
        //     0x9BB542Fa2BBC47dF6d5Da1F38dc78a186EA89CaB
        // );
        addUniversity(
            "Universität Mannheim",
            0xDeDE610A052Cd63D055B1e957b1952525d924F7e
        );
        // addUniversity("TUM", 0xA5f4A3aa3cFAA342FC401580aE6Af12Ab56EA822);
        // addUniversity(
        // "The Hague University of Applied Sciences",
        // 0xE82971C4A32C82556F072C73125e48C4c9c33a59
        // );
    }
}
